import React from "react";

function Pagination(){
 
   return(
    <div>
       <div className="pagination">
  <button onClick={() => previousPage()}>Previous</button>
  <button onClick={() => nextPage()}>Next</button>
</div>
    </div>
   ) 
}
export default Pagination;
